package netgithub2;

public class DoWhileLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int n=0;
		while (n<=20) {
			n+=2;
			System.out.print(n+" / ");
		}
		System.out.println("\n");
		int s=1;
		do {
			System.out.print(s + " * ");
			s++;
		} while (s<10);

	}

}
